import React from "react";

export default (props: {
  onClick: (event: React.MouseEvent<HTMLButtonElement, MouseEvent>) => void;
}) => {
  return (
    <>
      <h1>My Pokedex</h1>
      <button onClick={props.onClick}>EXPLORE</button>
    </>
  );
};
